SELECT * FROM  itblnodeszerolevels	
WHERE
	dteDate = '20140812'
	AND dteTime > '1900-01-01 15:21:08.000'
	AND intSerialZero  IN (
973
,974
,975
,976
,977
,978
,1127
,1144
,1146
,1451)





SELECT A.intSerialZero,intBeg,a.dblValue,dteTime FROM  itblnodeszerolevels AS A
	INNER JOIN itblnodeszerocatalog  AS B
	ON a.intSerialZero = b.intSerialZero
	WHERE dteDate = '20140812'
	AND txtCategory = 'UTIE'
	AND intBeg IN (
	84,168,252,364,728,1092,1456,1820,2548,3640,4368,5460,7280,10920
	)
	--AND dteTime > '1900-01-01 14:48:38.000' 
	ORDER BY 2




